import {useGlobalContext} from './context'
import Code from './prisumh'
// import plugins from '../'

const Blog=()=>{

    const code=`
<h1>zeel</h1>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
            <img> zeel>=</img>
    `;

    const {BlogData}=useGlobalContext();
    console.log(BlogData)
    let dic=BlogData.find((data)=>data.id===1) 

    return (
        <article className="blog-container">
            {
             dic["Blog"].map((arr)=>{
                if(arr[0]==="title"){
                    return <h1 >{arr[1]}</h1>
                }else if(arr[0]==="text"){
                    return <div className="para">
                        {arr[1]}
                    </div>
                }
                // eslint-disable-next-line jsx-a11y/alt-text
                return <img  src={arr[1]} className="img" />

             })
            }

            <Code code={code}
            plugins="" language="html"></Code>



{/* <pre><code class="language-css">p { color: red }</code></pre> */}


        </article>
    )
}

export default Blog;
